#!/usr/bin/env node

/**
 * Test script to send a sample webhook to the changedetection dashboard
 * Usage: node test-webhook.js
 */

const sampleWebhookData = {
    version: "1.0",
    title: "TPE to SEA, 11/30",
    message:
        "<del>$449 â\x80¢</del>\n**$353 â\x80¢**\n---\n\n[[Watch URL](https://www.kayak.com/flights/TPE-OSA/2025-11-30/2adults/children-1L-11?fs=providers%3D-ONLY_DIRECT%2CBUDGETAIR%2CCHEAPOAIR%2CEDREAMSAIR%2CFLIGHTHUB%2CGOTOGATE%2CJUSTFLYCA%2CSKYPICKER%2CAIRTICKETS24DOTCOM%2CONETRAVEL%2COOJO%3Bstops%3D~0%3Blanding%3D0600%2C2049&ucs=1me35v8&sort=bestflight_a)] [[Diff URL](https://changedetection.navedshome.tk//diff/fc1ffcdf-fcd9-4a12-8cb0-22ba332c400c)] [[Edit](https://changedetection.navedshome.tk//edit/fc1ffcdf-fcd9-4a12-8cb0-22ba332c400c#general)]",
    attachments: [
        {
            filename: "last-screenshot.png",
            base64: "",
            mimetype: "image/png",
        },
    ],
    type: "<NotifyType.INFO: 'info'>",
};

const credentials = Buffer.from(`admin:password`).toString("base64");

async function sendWebhook() {
    try {
        console.log("Sending test webhook to http://localhost:8080/api/webhook");

        const response = await fetch("http://localhost:8080/api/webhook", {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
                Authorization: `Basic ${credentials}`,
            },
            body: JSON.stringify(sampleWebhookData),
        });

        if (!response.ok) {
            throw new Error(`HTTP error! status: ${response.status}`);
        }

        const result = await response.json();
        console.log("Success! Response:", JSON.stringify(result, null, 2));
        console.log("\n✓ Webhook sent successfully!");
        console.log("\nNow open http://localhost:8080 in your browser to view the dashboard.");
    } catch (error) {
        console.error("Error sending webhook:", error.message);
        console.error("\nMake sure the server is running with: yarn dev");
        process.exit(1);
    }
}

sendWebhook();
